import CardData from "./CardData";
import Card from "./Card";
const Index = (props) => {
  return (
    <>
      <div>
        {CardData.map((val, i) => {
          return (
            <Card
              key={i}
              img={val.img}
              name={val.name}
              text={val.text}
              time={val.time}
            />
          );
        })}
      </div>
    </>
  );
};
export default Index;
